def get_PolygonArea(polygon_points):

    result_polygon = Polygon(polygon_points[:len(polygon_points)-1])

    return result_polygon.area



def get_IOU(original_points, new_points):


    original_area = Polygon(original_points)
    new_area = Polygon(new_points)

    is_intersects = original_area.intersects(new_area)
    if is_intersects:
        intersection_area = original_area.intersection(new_area)
        union_area = original_area.area + new_area.area - intersection_area.area
        rect = intersection_area.area / union_area
        o_i = original_area.area - intersection_area.area
        n_i = new_area.area - intersection_area.area
        return [original_area.area, new_area.area, o_i, n_i, intersection_area.area, union_area, rect]
    else:
        return -1


